import React from "react";

const ContactUs = () => {
  return (
    <React.Fragment>
      <form>
        <input type="text" name="name" placeholder="Full Name" required />
        <input type="email" name="email" placeholder="Email" required />
        <input
          type="text"
          name="message"
          placeholder="Message"
          className="message"
          required
        />
        <button type="submit">Send Message</button>
      </form>

      <style jsx>{`
        form {
          margin: 25px 0;
          width: 100%;
          border: 1px solid red;
          height: 280px;
          display: flex;
          flex-direction: column;
          align-items: center;
        }

        input {
          width: 50%;
          height: 30px;
          margin: 15px 0;
        }

        .message {
          height: 200px;
          position: relative;
        }

        .message::placeholder {
          position: absolute;
          color: red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default ContactUs;
